  \"Innovative Applications of DOD Propulsion Technology for Low-Cost Satellite Missions
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 8,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
